import React, { Component } from 'react';
import Bubble from './Bubble';

class Bubbles extends Component {
  render() {
    return (
      <div className="bubbles">
        <Bubble 
          background="radial-gradient( #588dff,#000000)"
          width="150"
          height="150"
          left="20%"
          duration="8s"
          delay="1s"
        />
      </div>
    );
  }
}

export default Bubbles;
